import React from 'react';

const SearchJobs: React.FC = () => {
  return (
    <div className="bg-gradient-to-br from-purple-50 via-purple-100 to-purple-50 rounded-xl p-8 md:p-12 lg:p-16 shadow-card">
      <div className="max-w-3xl mx-auto text-center">
        <h1 className="text-4xl font-bold text-primary-purple mb-8 md:mb-10">Search Jobs</h1>
        <div className="relative">
          <input
            type="text"
            placeholder="Search jobs by title, company or skill"
            className="w-full px-8 py-5 text-lg rounded-full border-2 border-gray-100 focus:outline-none focus:border-primary-purple focus:ring-2 focus:ring-primary-purple/20 shadow-sm"
          />
          <button 
            className="absolute right-3 top-1/2 transform -translate-y-1/2 bg-primary-purple text-white p-3 rounded-full hover:bg-purple-700 transition-colors duration-200"
            aria-label="Search"
          >
            <svg className="w-6 h-6" fill="none" viewBox="0 0 24 24" stroke="currentColor">
              <path strokeLinecap="round" strokeLinejoin="round" strokeWidth={2} d="M21 21l-6-6m2-5a7 7 0 11-14 0 7 7 0 0114 0z" />
            </svg>
          </button>
        </div>
      </div>
    </div>
  );
};

export default SearchJobs;
